import { faEdit, faPen } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import axios from 'axios';
import React, { useEffect, useState } from 'react';
import { Container, Input, InputGroupText } from 'reactstrap';
import Hml from '../../components/HML/Hml';
import './DealerMargin.css';
const states = [
  'Andhra Pradesh',
  'Arunachal Pradesh',
  'Assam',
  'Bihar',
  'Chhattisgarh',
  'Goa',
  'Gujarat',
  'Haryana',
  'Himachal Pradesh',
  'Jammu and Kashmir',
  'Jharkhand',
  'Karnataka',
  'Kerala',
  'Madhya Pradesh',
  'Maharashtra',
  'Manipur',
  'Meghalaya',
  'Mizoram',
  'Nagaland',
  'Odisha',
  'Punjab',
  'Rajasthan',
  'Sikkim',
  'Tamil Nadu',
  'Telangana',
  'Tripura',
  'Uttarakhand',
  'Uttar Pradesh',
  'West Bengal',
  'Andaman and Nicobar Islands',
  'Chandigarh',
  'Dadra and Nagar Haveli',
  'Daman and Diu',
  'Delhi',
  'Lakshadweep',
  'Puducherry',
];
const DealerMargin = () => {
  const [state, setState] = useState('Andhra Pradesh');
  const [margin, setMargin] = useState('');
  const [type, setType] = useState('');
  const [stateData, setStateData] = useState('');
  const selectHandle = (e) => {
    setState(e.target.value);
  };
  useEffect(
    () => () => {
      LoadMargin();
      LoadType();
    },
    [state]
  );
  console.log('stateData', stateData);
  const LoadMargin = async () => {
    const result = await axios.get('http://localhost:3003/dealerMargin');
    const sss = result.data[0];
    const filtered = Object.keys(sss);
    filtered.forEach((f) => {
      setStateData(sss[state]);
    });

    console.log('state', state);
    console.log('margin', margin);
    console.log('sss', sss);
    console.log('filtered', filtered);

    setMargin(result.data);
  };
  const LoadType = () => {
    const ssst = Object.keys(stateData);
    setType(ssst);
    console.log('type', typeof type);
  };

  return (
    <Container>
      <h4 className='pt-4 pb-5'>Dealer Margin</h4>
      <div className='selectState'>
        <label className='label' htmlFor='State'>
          State
        </label>
        <Input type='select' defaultValue='Set state' onChange={selectHandle}>
          <option value=''>Select state</option>
          {states.map((data, index) => {
            return (
              <option key={index} value={data} name={data}>
                {data}
              </option>
            );
          })}
        </Input>
      </div>
      {stateData === '' ? (
        ''
      ) : stateData === undefined ? (
        <div className='add_margin d-flex'>+ Add Margin</div>
      ) : (
        <>
          <Hml margin={type[0]} type='high' hirarchy='HML' />
          {console.log('stateData', stateData)}
        </>
      )}
    </Container>
  );
};

export default DealerMargin;
